import React from "react";

import { BrowserRouter as Router, Route } from "react-router-dom";
import {
  Card,
  CardBody,
  CharacterName,
  CardFooter,
  CardDetailsLink,
} from "./styles";

const PeopleCard = () => {
  return (
    <div>
      <Card>
        <CardBody>
          <CharacterName>Tlhogi</CharacterName>
        </CardBody>
        <CardFooter>
          <Router>
            <CardDetailsLink className="link" to="/">
              Details
            </CardDetailsLink>
          </Router>
        </CardFooter>
      </Card>
    </div>
  );
};

export default PeopleCard;
